import React from "react";
import ReactDOM from "react-dom";
import add from "./App";
ReactDOM.render(
  <>
    <ul>
      <li>Sum of 2 digit is{add(5, 6)}</li>
      <li>Sub of 2 digit</li>
    </ul>
  </>,
  document.getElementById("root")
);
